import React, { useState, useEffect } from 'react'
import axios from 'axios'
import Header from '../Utils/header'
import './style.scss'
import '../axios_interceptor'
import { storage_url } from '../constants'

function BankCardsInfo () {
  const [cards, setCards] = useState([])

  const card_info_request = async () => {

    try {
      const response = await axios.get(storage_url + "/account/getCardInfo")
      if (response.data.code === '-1') {
        alert("Something goes wrong Please log in again")
      } else {
        const res = response.data.result
        for (let i = 0; i < res.length; i++) {
          var new_card = new Card(res[i].cardNum, res[i].cardType, res[i].id)
          setCards([...cards, new_card])
        }
        console.log(cards)

      }
    } catch (error) {
      alert("Something goes wrong Please log in again")
    }

  }
  useEffect(() => {
    //card_info_request()
    var new_card = new Card("123", "test", 1)
    setCards([...cards, new_card])
    var new_card2 = new Card("1234", "test2", 2)
    setCards([...cards, new_card2])

  }, [])


  return (
    <div>
      <h1>All Bank Cards</h1>
      <table>
        <thead>
          <tr>
            <th>Card Number</th>
            <th>Card Type</th>
            <th>Expiration Date</th>
          </tr>
        </thead>
        <tbody>
          {cards.map((card) => (
            <tr key={card.id}>
              <td>{card.cardNumber}</td>
              <td>{card.cardType}</td>
              <td>{card.expirationDate}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  )
}

class Card {
  constructor(cardNumber, cardType, id) {
    this.cardNumber = cardNumber
    this.cardType = cardType
    this.id = id
  }
}

export default BankCardsInfo
